INSERT INTO DIARY VALUES(1052, '봄비가 내린 날, 동네 공원에서의 산책. 빗방울이 잔 pastel 너머로 내 흰 옷을 젖게 만들었지만, 그건 최고의 순간이었어.', 4, '기쁘네요', TO_DATE('2022-09-13', 'YYYY-MM-DD'), 1392);
