INSERT INTO DIARY VALUES(1489, '동네에서 열린 공연을 보러 가는 날. 반려동물이랑 나는 함께한 라이브 음악을 들으며 다정한 시간을 가졌어.', 200, '우울해요', TO_DATE('2022-03-01', 'YYYY-MM-DD'), 1929);
INSERT INTO DIARY VALUES(1490, '오늘은 우리의 작은 휴양지를 방문했어. 물가에 발을 담그고, 나뭇가지로 놀며 잊을 수 없는 순간을 보냈어. 향기로운 바람이 우리를 감싸주는 하루.', 65, '신나요', TO_DATE('2022-12-11', 'YYYY-MM-DD'), 374);
INSERT INTO DIARY VALUES(1491, '오늘은 산림욕을 즐기는 날. 푸른 나무들 아래, 반려동물은 자연을 탐험하고 나는 그의 활기찬 모습을 바라봤어.', 322, '희망적이에요', TO_DATE('2022-10-27', 'YYYY-MM-DD'), 1951);
INSERT INTO DIARY VALUES(1492, '청량한 가을날, 반려동물과 함께 과일농장을 방문했어. 신선한 과일을 따고 직접 만든 주스를 마셨어.', 482, '무기력해요', TO_DATE('2022-12-17', 'YYYY-MM-DD'), 783);
INSERT INTO DIARY VALUES(1493, '카페에서 반려동물과 차를 마실 때, 그의 친근한 눈빛이 내 힐링이었어. 함께 한 시간은 항상 내 기분을 밝혀줘.', 456, '나른해요', TO_DATE('2022-09-11', 'YYYY-MM-DD'), 1500);
INSERT INTO DIARY VALUES(1494, '비가 오는 날, 함께 물줄기에서 놀았어. 빗물과 미소로 가득 찬 하루.', 279, '안심돼요', TO_DATE('2022-08-05', 'YYYY-MM-DD'), 164);
INSERT INTO DIARY VALUES(1495, '오늘의 저녁은 홈메이드 간식 파티. 반려동물과 함께 요리하고 함께 맛있는 음식을 먹었어. 사랑 가득한 시간이었어.', 196, '상쾌해요', TO_DATE('2022-08-12', 'YYYY-MM-DD'), 1127);
INSERT INTO DIARY VALUES(1496, '오늘의 저녁은 홈메이드 간식 파티. 반려동물과 함께 요리하고 함께 맛있는 음식을 먹었어. 사랑 가득한 시간이었어.', 31, '상쾌해요', TO_DATE('2022-07-23', 'YYYY-MM-DD'), 316);
INSERT INTO DIARY VALUES(1497, '이른 아침, 바다로 뛰어들었어. 반려동물은 파도와 함께 놀며 나는 일출을 관람. 바다는 언제나 우리의 공동 놀이터야.', 186, '불안해요', TO_DATE('2022-10-12', 'YYYY-MM-DD'), 526);
INSERT INTO DIARY VALUES(1498, '카페에서 반려동물과 차를 마실 때, 그의 친근한 눈빛이 내 힐링이었어. 함께 한 시간은 항상 내 기분을 밝혀줘.', 337, '나른해요', TO_DATE('2022-02-05', 'YYYY-MM-DD'), 2048);
INSERT INTO DIARY VALUES(1499, '낡은 책방을 찾아 반려동물과 책을 읽었어. 햇빛이 창으로 비추는 곳에서, 우리는 다른 세계로 여행한 느낌.', 212, '뿌듯해요', TO_DATE('2022-08-19', 'YYYY-MM-DD'), 44);
INSERT INTO DIARY VALUES(1500, '청량한 가을날, 반려동물과 함께 과일농장을 방문했어. 신선한 과일을 따고 직접 만든 주스를 마셨어.', 325, '무기력해요', TO_DATE('2022-11-04', 'YYYY-MM-DD'), 1466);
